INSERT INTO `cmf_language` VALUES (4, '1、欢迎来到温莎直播，永久域名ws.app，倡导绿色文明直播。\n2、【官方推荐】即日起晚18:00—早8:00使用【公司入款】充值每笔将赠送5%的优惠哦，安全快速到账，祝您游戏愉快，盈利多多~\n3、Go币（Gopay）充值笔笔赠送5%彩金，急速到账，安全方便', '1. Welcome to Windsor Live, permanent domain name ws.app, advocating green civilization live broadcast,\n2. [Official recommendation] From 18:00 pm to 8:00 am from now on, use [Company Deposit] to recharge, and each recharge will give a 5% discount, which is safe and fast to the account. I wish you a happy game and a lot of profit~\n3. Go coin (Gopay) top-up will give you 5% bonus, which will be credited quickly, safe and convenient', '1. Chào mừng bạn đến với Windsor Live, tên miền vĩnh viễn ws.app, ủng hộ việc phát sóng trực tiếp nền văn minh xanh,\n2. [Khuyến nghị chính thức] Từ 18:00 đến 8:00 sáng kể từ bây giờ, bạn sẽ nhận được chiết khấu 5% cho mỗi lần nạp tiền bằng cách sử dụng [Gửi tiền của công ty], rất an toàn và nhanh chóng. Chúc các bạn chơi game vui vẻ và nhiều lợi nhuận ~\n3. Nạp tiền bằng Go xu (Gopay) sẽ mang lại cho bạn 5% tiền thưởng, sẽ được cộng nhanh chóng, an toàn và tiện lợi', '1. ยินดีต้อนรับสู่ Windsor Live ชื่อโดเมนถาวร ws.app สนับสนุนการถ่ายทอดสดอารยธรรมสีเขียว\n2. [คำแนะนำอย่างเป็นทางการ] ตั้งแต่ 18:00 น. ถึง 8.00 น. จากนี้ไปคุณจะได้รับส่วนลด 5% สำหรับการเติมเงินแต่ละครั้งโดยใช้ [Company Deposit] ซึ่งปลอดภัยและรวดเร็ว ขอให้เกมมีความสุขและ กำไรเยอะ~\n3. การเติมเงิน Go coin (Gopay) จะทำให้คุณได้รับโบนัส 5% ซึ่งจะได้รับเครดิตอย่างรวดเร็ว ปลอดภัย และสะดวกสบาย', '1. Selamat datang ke Windsor Live, nama domain kekal ws.app, menyokong siaran langsung tamadun hijau,\n2. [Cadangan rasmi] Dari 18:00 p.m. hingga 8:00 a.m. mulai sekarang, anda akan menerima diskaun 5% untuk setiap caj semula menggunakan [Deposit Syarikat], yang selamat dan pantas. Saya ucapkan selamat bermain dan untung banyak~\n3. Tambah nilai Go coin (Gopay) akan memberi anda bonus 5%, yang akan dikreditkan dengan cepat, selamat dan mudah', '1. Selamat datang di Windsor Live, nama domain permanen ws.app, menganjurkan siaran langsung peradaban hijau,\n2. [Rekomendasi resmi] Mulai pukul 18:00 hingga 8:00 mulai sekarang, Anda akan menerima diskon 5% untuk setiap pengisian ulang menggunakan [Deposit Perusahaan], yang aman dan cepat. Semoga permainan Anda menyenangkan dan untung banyak~\n3. Top-up Go coin (Gopay) akan memberi Anda bonus 5%, yang akan dikreditkan dengan cepat, aman, dan nyaman', 1, 3, 59459, 1649683511, 1649744002);
