INSERT INTO `cmf_noble_setting` VALUES (1, 1, '&lt;p style=&quot;line-height:2;&quot;&gt;&lt;b style=&quot;&quot;&gt;&lt;font color=&quot;#c24f4a&quot; face=&quot;楷体&quot; style=&quot;&quot; size=&quot;6&quot;&gt;如何更换贵族？&lt;/font&gt;&lt;/b&gt;✨✨✨✨✨✨✨✨✨✨&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;font size=&quot;2&quot;&gt;1.若已开通贵族，可继续开通更高等级的贵族，但不能开通低于当前等级的贵族。&lt;/font&gt;&lt;/b&gt;&lt;b&gt;&lt;font size=&quot;2&quot;&gt;例如：您已是【公爵】，您可开通【国王】，但是不能开通【侯爵】。一旦成功开通【国王】，您将获得【国王】的所有特权，原有【公爵】身份将失效。&lt;/font&gt;&lt;/b&gt;🎉🎉&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;font size=&quot;2&quot;&gt;2.贵族身份有效期内，可通过续费优惠价延长当前贵族有效期。&lt;/font&gt;&lt;/b&gt;🎉🎉&lt;/p&gt;&lt;p&gt;&lt;b style=&quot;&quot;&gt;&lt;font size=&quot;2&quot;&gt;3.若贵族身份已过期，则无法享受续费优惠，可重新开通任意等级贵族。&lt;/font&gt;&lt;/b&gt;🎉🎉&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 3, 83581, 1651901486, 1655474152);
INSERT INTO `cmf_noble_setting` VALUES (2, 0, 'wvcecec', 1, 1, 1651901502, 0);
INSERT INTO `cmf_noble_setting` VALUES (3, 1, '&lt;p&gt;&lt;b&gt;如何更换贵族？&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;1.若已开通贵族，可继续开通更高等级的贵族，但不能开通低于当前等级的贵族。&lt;/b&gt;&lt;b&gt;例如：您已是【公爵】，您可开通【国王】，但是不能开通【侯爵】。一旦成功开通【国王】，您将获得【国王】的所有特权，原有【公爵】身份将失效。&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;2.贵族身份有效期内，可通过续费优惠价延长当前贵族有效期。&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;3.若贵族身份已过期，则无法享受续费优惠，可重新开通任意等级贵族。&lt;/b&gt;&lt;/p&gt;', 28, 64283, 1653983472, 1658154260);
