  `reward_money` decimal(12, 2) NULL DEFAULT 0.00 COMMENT '赏金',
  `tenant_id` int(11) NULL DEFAULT NULL COMMENT '租户id',
  `comments_number` int(11) NULL DEFAULT 0 COMMENT '评论数（求片时为推片数）',
  `like_number` int(11) NULL DEFAULT 0 COMMENT '点赞数',
