  `start_integral` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '发生前积分',
  `change_integral` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '发生积分',
  `end_integral` decimal(20, 2) NULL DEFAULT 0.00 COMMENT '操作后积分',
