-- ----------------------------
-- Table structure for cmf_livepushpull
-- ----------------------------
DROP TABLE IF EXISTS `cmf_livepushpull`;
CREATE TABLE `cmf_livepushpull`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '线路名称',
  `code` tinyint(4) NOT NULL COMMENT '推拉流服务商：1,2,3,4,5,6,7,8,9',
  `ct_type` tinyint(3) NOT NULL DEFAULT 1 COMMENT '线路类型：1.默认，2.yellow,3.green',
