  `pull` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '播流域名',
  `appname` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '直播空间名称',
  `appid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '直播appid',
  `bizid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '直播bizid',
  `push_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '推流鉴权KEY/appkey',
  `push_length` int(11) NOT NULL DEFAULT 0 COMMENT '推流鉴权有效时长',
  `pull_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '播流鉴权KEY',
  `pull_length` int(11) NOT NULL DEFAULT 0 COMMENT '播流鉴权有效时长',
  `accesskey` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'AccessKey',
  `secretkey` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'SecretKey',
  `push_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '推流地址',
  `pull_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '播流地址',
  `flv_pull_url` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT 'flv_pull_url',
  `hls_pull` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'hls_pull',
  `certificate` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'App证书',
  `auth_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否鉴权',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '状态: 0.关闭，1.启用',
  `bypass_ratio` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分流比例，单位：%',
  `act_uid` int(11) NOT NULL COMMENT '操作人id',
