  `yuebao_rate` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '米利宝利息',
  `yuebao_explain` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '米利宝规则说明',
  `transfer_auto` tinyint(1) NOT NULL DEFAULT 0 COMMENT '米利宝 自动转入开关',
  `shop_explain` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商城说明配置',
  `shop_switch` tinyint(1) NOT NULL DEFAULT 0 COMMENT '前端是否展示绑定按钮',
  `yp_apikey` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '云片ApiKey',
  `shop_h5_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商城H5url',
  `shop_h5_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商城H5名称',
  `tickets_limit_min` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '门票房间限额(最小值)',
  `tickets_limit_max` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '门票房间限额(最大值)',
  `charoom_min_livetime` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '收费房间最低直播时间',
  `trywatchtime` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '非普通房间试看时间',
  `livet_timeout` int(11) NOT NULL DEFAULT 0 COMMENT '直播暂停超时时间',
  `live_nums_min` int(11) NOT NULL DEFAULT 0 COMMENT '直播初始人数(min)',
  `live_nums_max` int(11) NOT NULL DEFAULT 0 COMMENT '直播初始人数(max)',
  `iospush_resolution` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'IOS推流分辨率',
  `iospush_codere` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'IOS推流码率(视频码率)',
  `adpush_resolution` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '安卓推流分辨率',
  `adpush_codere` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '安卓推流码率(视频码率)',
  `iosprev_coll_frame` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'IOS预览采集帧率',
  `ios_coll_frame` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT 'IOS采集帧率',
  `ios_coll_resolution` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'IOS采集分辨率',
  `iospush_coll_resolution` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'IOS推流采集帧率',
  `iosliveprev_resolution` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT 'IOS直播预览分辨率',
  `adprev_coll_frame` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '安卓预览采集帧率',
  `ad_coll_frame` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '安卓采集帧率',
  `ad_coll_resolution` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '安卓采集分辨率',
  `adpush_coll_resolution` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '安卓推流采集帧率',
  `adliveprev_resolution` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '安卓直播预览分辨率',
  `push_encode_profile` tinyint(1) NOT NULL DEFAULT 3 COMMENT '安卓功耗',
  `qdy_push` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '青点云推流地址',
  `qdy_pull` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '青点云播流地址',
  `live_fans_min` int(11) NOT NULL DEFAULT 0 COMMENT '直播初始粉丝人数(最小)',
  `live_fans_max` int(11) NOT NULL DEFAULT 0 COMMENT '直播初始粉丝人数(最大)',
  `live_votestotal_min` int(11) NOT NULL DEFAULT 0 COMMENT '直播初始收入打赏(最小)',
  `live_votestotal_max` int(11) NOT NULL DEFAULT 0 COMMENT '直播初始收入打赏(最大)',
  `tenant_id` int(11) NOT NULL DEFAULT 0 COMMENT '租户编号',
  `go_root_url` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'golang根地址',
  `url_of_push_to_java_cut_video` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '上传视频到java切片处理地址',
  `url_of_get_video_info_from_java` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '定时器定时从java获取切片视频信息地址',
  `bank_bind_limit_count` int(11) NOT NULL DEFAULT 0 COMMENT '同一银行卡限时时间内最多绑定次数，0不限制',
  `bank_bind_limit_day` int(11) NOT NULL DEFAULT 0 COMMENT '同一银行卡限时时间（单位：天）',
  `bank_realname_bind_limit_count` int(11) NOT NULL DEFAULT 0 COMMENT '同一银行卡姓名绑定限时时间内最多绑定次数，0不限制',
  `bank_realname_bind_limit_day` int(11) NOT NULL DEFAULT 0 COMMENT '同一银行卡姓名绑定限时时间（单位：天）',
  `usdt_address_bind_limit_count` int(11) NOT NULL DEFAULT 0 COMMENT '同一USDT地址限时时间内最多绑定次数，0不限制',
  `usdt_address_bind_limit_day` int(11) NOT NULL DEFAULT 0 COMMENT '同一USDT地址限时时间（单位：天）',
  `bank_bind_count_one_user` int(11) NOT NULL DEFAULT 0 COMMENT '同一会员绑定银行卡数量，0不限制',
  `usdt_bind_count_one_user` int(11) NOT NULL DEFAULT 0 COMMENT '同一会员绑定usdt地址数量，0不限制',
  `long_video_order_count` int(11) NOT NULL DEFAULT 0 COMMENT '长视频购买数量（用于约会项目）',
  `football_live_base_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '足球视频直播基础url',
  `football_live_token` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '足球视频直播token',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `tenant_id`(`tenant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '平台公共设置表' ROW_FORMAT = Dynamic;

