  `url` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '播放地址',
  `is_enable` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否启用',
  `viode_table_field` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '对应视频表的播放字段',
  `type` tinyint(2) NULL DEFAULT 1 COMMENT '1播放线路2 下载线路',
  `java_field` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'java返回对应字段',
