-- ----------------------------
-- Table structure for cmf_plugins
-- ----------------------------
DROP TABLE IF EXISTS `cmf_plugins`;
CREATE TABLE `cmf_plugins`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '插件名，英文',
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '插件名称',
  `description` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '插件描述',
  `type` tinyint(2) NULL DEFAULT 0 COMMENT '插件类型, 1:网站；8;微信',
  `status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '状态；1开启；',
  `config` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '插件配置',
  `hooks` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '实现的钩子;以“，”分隔',
  `has_admin` tinyint(2) NULL DEFAULT 0 COMMENT '插件是否有后台管理界面',
  `author` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '插件作者',
  `version` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '插件版本号',
  `createtime` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '插件安装时间',
  `listorder` smallint(6) NOT NULL DEFAULT 0 COMMENT '排序',
  `tenant_id` bigint(20) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_posts
-- ----------------------------
DROP TABLE IF EXISTS `cmf_posts`;
CREATE TABLE `cmf_posts`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `post_author` bigint(20) UNSIGNED NULL DEFAULT 0 COMMENT '发表者id',
  `post_keywords` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'seo keywords',
  `post_source` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '转载文章的来源',
  `post_date` datetime(0) NULL DEFAULT '2000-01-01 00:00:00' COMMENT 'post创建日期，永久不变，一般不显示给用户',
  `post_content` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'post内容',
  `post_title` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'post标题',
  `post_excerpt` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'post摘要',
  `post_status` int(2) NULL DEFAULT 1 COMMENT 'post状态，1已审核，0未审核',
  `comment_status` int(2) NULL DEFAULT 1 COMMENT '评论状态，1允许，0不允许',
  `post_modified` datetime(0) NULL DEFAULT '2000-01-01 00:00:00' COMMENT 'post更新时间，可在前台修改，显示给用户',
  `post_content_filtered` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `post_parent` bigint(20) UNSIGNED NULL DEFAULT 0 COMMENT 'post的父级post id,表示post层级关系',
  `post_type` int(2) NULL DEFAULT NULL,
  `post_mime_type` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `comment_count` bigint(20) NULL DEFAULT 0,
  `smeta` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'post的扩展字段，保存相关扩展属性，如缩略图；格式为json',
  `post_hits` int(11) NULL DEFAULT 0 COMMENT 'post点击数，查看数',
  `post_like` int(11) NULL DEFAULT 0 COMMENT 'post赞数',
  `istop` tinyint(1) NULL DEFAULT 0 COMMENT '置顶 1置顶； 0不置顶',
  `recommended` tinyint(1) NULL DEFAULT 0 COMMENT '推荐 1推荐 0不推荐',
  `orderno` int(10) NULL DEFAULT 0,
  `type` int(3) NULL DEFAULT 0,
  `tenant_id` bigint(20) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `type_status_date`(`post_type`, `post_status`, `post_date`, `id`) USING BTREE,
  INDEX `post_parent`(`post_parent`) USING BTREE,
  INDEX `post_author`(`post_author`) USING BTREE,
  INDEX `post_date`(`post_date`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_profit_daysharing
-- ----------------------------
DROP TABLE IF EXISTS `cmf_profit_daysharing`;
CREATE TABLE `cmf_profit_daysharing`  (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `collet_day` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '日期',
  `tenant_id` int(12) NOT NULL COMMENT '租户id',
  `tenant_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '租户名称',
  `cp_share` float(16, 3) NULL DEFAULT NULL COMMENT '彩票分成',
  `zb_share` float(16, 3) NULL DEFAULT NULL COMMENT '礼物分成',
  `cpjz_share` float(16, 3) NULL DEFAULT NULL COMMENT '彩票分成（家族）',
  `zbjz_share` float(16, 3) NULL DEFAULT NULL COMMENT '礼物分成（家族）',
  `cpzb_share` float(16, 3) NULL DEFAULT NULL COMMENT '彩票分成（主播）',
  `zbzb_share` float(16, 3) NULL DEFAULT NULL COMMENT '礼物分成（主播）',
  `addtime` int(12) NULL DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `action_uid_addtime`(`collet_day`, `tenant_name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_profit_sharing
-- ----------------------------
DROP TABLE IF EXISTS `cmf_profit_sharing`;
CREATE TABLE `cmf_profit_sharing`  (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uid` int(12) NULL DEFAULT NULL COMMENT '主播ID',
  `status` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '状态',
  `updatetime` int(12) NULL DEFAULT NULL COMMENT '结算时间',
  `addtime` int(12) NOT NULL DEFAULT 0 COMMENT '处理时间',
  `anchor_tenant` int(12) NULL DEFAULT NULL COMMENT '主播平台',
  `send_tenant` int(12) NULL DEFAULT NULL COMMENT '消费者平台',
  `anchor_money` float(16, 3) NULL DEFAULT NULL COMMENT '主播平台收益',
  `send_money` float(16, 3) NULL DEFAULT NULL COMMENT '消费者平台收益',
  `anthor_total` float(16, 3) NULL DEFAULT NULL COMMENT '主播收益',
  `family_total` float(16, 3) NULL DEFAULT NULL COMMENT '家族收益',
  `is_type` tinyint(2) NULL DEFAULT NULL COMMENT '1  送礼 2 彩票',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `action_uid_addtime`(`status`, `updatetime`, `addtime`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

