-- ----------------------------
-- Table structure for cmf_pushrecord
-- ----------------------------
DROP TABLE IF EXISTS `cmf_pushrecord`;
CREATE TABLE `cmf_pushrecord`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `touid` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '推送对象',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '推送内容',
  `adminid` int(11) NOT NULL COMMENT '管理员ID',
  `admin` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '管理员账号',
  `ip` bigint(20) NOT NULL DEFAULT 0 COMMENT '管理员IP地址',
  `addtime` int(11) NOT NULL DEFAULT 0 COMMENT '发送时间',
  `tenant_id` bigint(20) NULL DEFAULT NULL,
