-- ----------------------------
-- Table structure for cmf_rate
-- ----------------------------
DROP TABLE IF EXISTS `cmf_rate`;
CREATE TABLE `cmf_rate`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '币种名称',
  `code` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '币种简称',
  `rate` decimal(12, 4) NOT NULL DEFAULT 0.0000 COMMENT '汇率',
  `status` tinyint(4) NOT NULL DEFAULT 1 COMMENT '1启用：2禁用',
  `icon` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '图标',
  `is_virtual` int(4) NOT NULL DEFAULT 0 COMMENT '是否为虚拟币，1是 0不是',
  `sort` tinyint(4) NOT NULL DEFAULT 1 COMMENT '排序',
  `tenant_id` tinyint(10) NOT NULL DEFAULT 0 COMMENT '租户id',
  `operated_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '操作者',
  `ctime` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `mtime` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UINDEX-code-tenant_id`(`code`, `tenant_id`) USING BTREE,
  UNIQUE INDEX `UINDEX-name-tenant_id`(`name`, `tenant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

