  `offlinepay_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '线下id',
  `channel_account_id` varchar(225) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '子渠道',
  `add_time` int(11) NOT NULL DEFAULT 0 COMMENT '添加时间 ',
  `tenant_id` int(11) NOT NULL DEFAULT 0 COMMENT '租户id',
