  `uid` int(11) NOT NULL DEFAULT 0 COMMENT '用户ID',
  `user_login` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户账号',
  `user_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '用户类型: 2.会员, 3.虚拟用户, 4.游客, 5.包装账号, 6.代管账号, 7.测试账号',
  `datenum` int(11) NOT NULL DEFAULT 0 COMMENT '批次ID',
  `pre_balance` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '领取前余额',
  `coin` int(11) NOT NULL DEFAULT 0 COMMENT '金额',
  `after_balance` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '领取后余额',
