-- ----------------------------
-- Table structure for cmf_red_setting
-- ----------------------------
DROP TABLE IF EXISTS `cmf_red_setting`;
CREATE TABLE `cmf_red_setting`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tenant_id` int(11) NULL DEFAULT 0 COMMENT '租户id',
  `name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '红包名称',
  `red_time` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '红包时间点',
  `last_time` int(12) NULL DEFAULT 0 COMMENT '最长抢红包时间',
  `money_min` int(12) NOT NULL DEFAULT 0 COMMENT '最小红包',
  `money_max` int(10) NOT NULL DEFAULT 0 COMMENT '最大红包',
  `red_total` int(12) NOT NULL DEFAULT 0 COMMENT '红包总金额',
  `red_num` int(12) NOT NULL DEFAULT 0 COMMENT '红包个数',
  `addtime` int(11) NULL DEFAULT 0 COMMENT '添加时间',
  `update_time` int(11) NOT NULL DEFAULT 0 COMMENT '更新时间',
  `game_tenant_id` int(10) NOT NULL DEFAULT 0 COMMENT '游戏租户id',
  `multiple` int(11) NOT NULL DEFAULT 1 COMMENT '倍数（实际领取的红包就是抢到金额的M倍）',
  `operated_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '操作人',
  `vip_grade` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'vip等级（多个等级用英文逗号“,”分隔）',
  `uids` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '用户id列表',
  `vip_conf` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'vip金额配置（json）',
  `effect_time_start` int(11) NOT NULL DEFAULT 0 COMMENT '生效时间',
  `effect_time_end` int(11) NOT NULL DEFAULT 0 COMMENT '结束时间',
  `second_time` int(10) NULL DEFAULT 0 COMMENT '抢红包分钟数',
  `effect_time` int(10) NULL DEFAULT 0 COMMENT '抢红包有效时间',
  `win_time` int(10) NULL DEFAULT 0 COMMENT '能抢到红包时间',
  `type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '奖品类型：1.金钱，2.购物券',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UINDEX-tenant_id-name`(`tenant_id`, `name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

