  `reg_withdrawable_coin3` int(11) NOT NULL DEFAULT 0 COMMENT '三等奖',
  `reg_nowithdrawable_coin2` int(11) NOT NULL DEFAULT 0 COMMENT '二等奖',
  `reg_nowithdrawable_coin3` int(11) NOT NULL DEFAULT 0 COMMENT '三等奖',
  `firstlog_withdrawable_coin2` int(11) NOT NULL DEFAULT 0 COMMENT '二等奖',
  `firstlog_withdrawable_coin3` int(11) NOT NULL DEFAULT 0 COMMENT '三等奖',
  `firstlog_nowithdrawable_coin2` int(11) NOT NULL DEFAULT 0 COMMENT '二等奖',
  `firstlog_nowithdrawable_coin3` int(11) NOT NULL DEFAULT 0 COMMENT '三等奖',
