  `voice_notice` tinyint(1) NOT NULL DEFAULT 0 COMMENT '语音播报开关：0.否，1是',
  `is_open_seeking_slice` tinyint(4) NULL DEFAULT 1 COMMENT '是否开启求片(贴吧) 1开启 0 关闭',
  `posting_strategy` tinyint(4) NULL DEFAULT 1 COMMENT '1全开启 发帖策略  0 全关闭，3按vip',
  `comment_strategy` tinyint(4) NULL DEFAULT 1 COMMENT '评论策略(1 全开启 0 全关闭 ，2按vip)',
  `seeking_slice_strategy` tinyint(4) NULL DEFAULT 1 COMMENT '发求片策略 (1 全开启 0 全关闭 ，2按vip)',
  `push_strategy` tinyint(4) NULL DEFAULT 1 COMMENT '推片策略 (1 全开启 0 全关闭 ，2按vip)',
  `seeking_slice_effective_time` int(11) NULL DEFAULT 0 COMMENT '求片有效时间（单位： 秒）',
  `seeking_slice_bonus_min` decimal(12, 2) NULL DEFAULT 0.00 COMMENT '推片悬赏金最少值',
  `seeking_slice_bonus_max` decimal(12, 2) NULL DEFAULT 0.00 COMMENT '推片悬赏金最大值',
  `reward_is_withdrawal` tinyint(4) NULL DEFAULT 1 COMMENT '是否可提现（推片悬赏金）1 可提现 0 不可提现',
  `agent_sum` tinyint(2) NULL DEFAULT 20 COMMENT '代理层数（目前）',
  `commission_type` tinyint(2) NULL DEFAULT 1 COMMENT '1 7 日可转提现 2  永不可提现',
  `video_likes_amount` decimal(12, 2) NOT NULL DEFAULT 0.00 COMMENT '视频点赞佣金',
  `video_likes_amount_type` tinyint(2) NOT NULL DEFAULT 1 COMMENT '视频点赞佣金类型  1 可提现 2 不可提现 （代理佣金 一致）',
  `video_buy_amount` decimal(12, 2) NOT NULL DEFAULT 0.00 COMMENT '购买视频佣金',
  `video_buy_amount_type` tinyint(2) NOT NULL DEFAULT 1 COMMENT ' 购买视频佣金类型 1 可提现  2 不可提现',
  `video_uplode_amount` decimal(12, 0) NOT NULL DEFAULT 0 COMMENT '上传视频佣金',
  `video_uplode_amount_type` tinyint(2) NOT NULL DEFAULT 1 COMMENT ' 上传视频佣金类型 1可提现  2， 不可提现',
  `withdrawal_time` int(11) NOT NULL DEFAULT 7 COMMENT '不可提现转可提现日期设置',
  `share_award_amount_type` tinyint(4) NOT NULL DEFAULT 1 COMMENT '分享奖励类型 1 可提现 2 ，不可提现',
  `first_charge_award_amount_type` tinyint(4) NOT NULL DEFAULT 1 COMMENT ' 首充奖励金额类型 1 可提现 2 不可提现',
  `vip_model` tinyint(4) NOT NULL DEFAULT 1 COMMENT '1 购买模式，2保证金模式',
  `code_show` tinyint(4) NOT NULL DEFAULT 1 COMMENT '展示 ，2 不展示',
  `treasure_swich` tinyint(4) UNSIGNED ZEROFILL NOT NULL DEFAULT 0001 COMMENT ' 1 开始 2 关闭',
  `initial_membership` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员初始等级',
  `is_use_visitor` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否使用游客：0.否，1.是',
  `sing_is_show` tinyint(2) NOT NULL DEFAULT 1 COMMENT '签到是否展示 1 展示 2 不展示 ',
  `sing_award_type` tinyint(2) NOT NULL DEFAULT 1 COMMENT '签到奖励类型 1 转盘 2 金额',
  `red_packet_icon` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '红包图标',
  `red_packet_special_effects` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '红包特效（图片或动画）',
  `red_packet_shopvoucher_special_effects` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '红包购物券特效图标',
  `turntable_is_show` tinyint(2) NOT NULL DEFAULT 1 COMMENT '转盘是否显示 1 显示  0  隐藏',
  `turntable_desc` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  `turntable_is_effect` tinyint(2) NOT NULL DEFAULT 1 COMMENT ' 转盘是否生效  1 生效   0 失效',
  `pop_time` int(11) NOT NULL DEFAULT 0 COMMENT '约会详情页弹窗',
  `tourists_watch_time` int(11) NOT NULL DEFAULT 0 COMMENT '游客观看次数',
  `vip_watch_time` int(11) NOT NULL DEFAULT 0 COMMENT '正式用户 观看次数',
  `agent_line_visible` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否视频代理线可见：0.否，1.是',
  `top_short_video_count` int(11) NOT NULL DEFAULT 1 COMMENT '置顶视频数量',
  `auto_check_short_video` tinyint(1) NOT NULL DEFAULT 0 COMMENT '自动审核：0.否，1.是',
  `turntable_consumption_amout` int(11) NOT NULL DEFAULT 0 COMMENT '转盘抽奖消费金额',
  `order_statistics_code` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  `start_page_countdown` int(11) NOT NULL DEFAULT 0 COMMENT '启动页广告倒计时',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `tenant_id`(`tenant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '租户设置表' ROW_FORMAT = Dynamic;

