  `user_name` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '会员名称',
  `content` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '禁言内容',
  `shut_times` int(5) NULL DEFAULT NULL COMMENT '禁言次数',
  `uid` int(5) NULL DEFAULT NULL COMMENT '会员id',
  `outroom_times` int(5) NULL DEFAULT NULL COMMENT '触发踢出房间',
