-- ----------------------------
-- Table structure for cmf_user_task
-- ----------------------------
DROP TABLE IF EXISTS `cmf_user_task`;
CREATE TABLE `cmf_user_task`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '用户id',
  `vip_id` int(11) NOT NULL COMMENT '会员等级',
  `task_id` int(11) NOT NULL COMMENT '任务id',
  `task_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务名称',
  `task_type` tinyint(2) NOT NULL COMMENT '任务类型：1初级任务，2中级任务，3高级任务',
  `classification` int(11) NOT NULL COMMENT '任务分类',
  `client` tinyint(2) NOT NULL COMMENT '客户端：1PC，2H5，3Android，4iOS',
  `experience_shop` tinyint(2) NOT NULL COMMENT '是否体验商城: 0否，1是',
  `commission_rate` decimal(4, 3) NOT NULL DEFAULT 0.000 COMMENT '佣金比例',
  `price` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '任务价格',
  `reward1` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '完成奖励1',
  `reward2_upgrade_vip` tinyint(2) NOT NULL DEFAULT 0 COMMENT '完成奖励2：是否升级VIP等级: 0否，1是 ',
  `start_time` int(11) NOT NULL DEFAULT 0 COMMENT '生效时间',
  `end_time` int(11) NOT NULL DEFAULT 0 COMMENT '失效时间',
  `status` tinyint(2) NOT NULL COMMENT '用户任务状态：0已取消，1进行中，2审核中，3审核通过（已完成），4审核拒绝',
  `remark` varchar(160) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `act_uid` int(11) NOT NULL DEFAULT 0 COMMENT '操作人id',
  `tenant_id` int(11) NOT NULL COMMENT '租户id',
  `ctime` int(11) NOT NULL COMMENT '提交时间',
  `mtime` int(11) NOT NULL DEFAULT 0 COMMENT '操作时间',
  `submit_time` int(11) NOT NULL DEFAULT 0 COMMENT '任务提交时间',
  `only_one` tinyint(2) NOT NULL DEFAULT 0 COMMENT '任务策略',
  `today_ischeck` tinyint(2) NOT NULL DEFAULT 0 COMMENT '今日是否已经审核',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

