-- Table structure for cmf_user_transfer_yuebao
-- ----------------------------
DROP TABLE IF EXISTS `cmf_user_transfer_yuebao`;
CREATE TABLE `cmf_user_transfer_yuebao`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT 0 COMMENT '转账用户id',
  `user_login` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '用户账号',
