  `type` tinyint(2) NOT NULL DEFAULT 0 COMMENT '余额宝操作类型，1转出到余额 2转出到银行卡',
  `amount` decimal(11, 2) NOT NULL DEFAULT 0.00 COMMENT '金额',
  `addtime` int(11) NOT NULL DEFAULT 0,
  `updatetime` int(11) NOT NULL DEFAULT 0,
  `status` tinyint(11) NOT NULL DEFAULT 1 COMMENT ' 1成功 2 ，待审核 ， 3 驳回',
  `tenant_id` int(11) NOT NULL DEFAULT 0 COMMENT '租户id',
  `operated_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '操作人',
  `bankname` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '银行名称',
  `banknumber` varchar(52) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '银行卡号',
  `realname` varchar(128) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '真实姓名',
  `phonenumber` varchar(52) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '手机号',
  `mark` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_users
-- ----------------------------
DROP TABLE IF EXISTS `cmf_users`;
CREATE TABLE `cmf_users`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `tenant_id` bigint(20) NULL DEFAULT NULL COMMENT '租户id',
  `user_login` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '用户名',
  `user_pass` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '登录密码；sp_password加密',
  `payment_password` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付密码',
  `payment_password_err_count` int(11) NOT NULL DEFAULT 0 COMMENT '支付密码错误次数',
  `salt` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付加密盐',
  `user_nicename` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '用户美名',
  `user_email` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '登录邮箱',
  `user_url` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户个人网站',
  `avatar` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户头像',
  `avatar_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '小头像',
  `sex` smallint(1) NULL DEFAULT 2 COMMENT '性别；0：保密，1：男；2：女',
  `birthday` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '生日',
  `signature` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '个性签名',
  `invitation_code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邀请码',
  `last_login_ip` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '最后登录ip',
  `last_login_time` datetime(0) NULL DEFAULT NULL COMMENT '最后登录时间',
  `login_num` int(11) NOT NULL DEFAULT 0 COMMENT '登录次数',
  `create_time` datetime(0) NOT NULL COMMENT '注册时间',
  `ctime` int(11) NOT NULL DEFAULT 0 COMMENT '创建时间',
  `user_activation_key` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '激活码',
  `user_status` int(11) NOT NULL DEFAULT 1 COMMENT '用户状态 0：禁用； 1：正常 ；2：未验证',
  `score` int(11) NOT NULL DEFAULT 0 COMMENT '用户积分',
  `user_type` smallint(1) NOT NULL DEFAULT 1 COMMENT '用户类型，1:admin,2:会员,3:虚拟用户,4:游客 ,5包装账号，6代管账号，7测试账号,8代理账号',
  `admin_type` smallint(1) NOT NULL DEFAULT 0 COMMENT '管理员类型：0.通用，1.家族族长',
  `coin` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '金币',
  `nftwithdrawable_coin` decimal(16, 2) NULL DEFAULT 0.00 COMMENT 'nft不可提现金币',
  `nowithdrawable_coin` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '不可提现金币',
  `withdrawable_coding` int(20) NOT NULL DEFAULT 0 COMMENT '可提现金币打码量',
  `mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `token` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '授权token',
  `expiretime` int(12) NOT NULL DEFAULT 0 COMMENT 'token 到期时间',
  `consumption` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '消费总额',
  `votes` decimal(20, 4) UNSIGNED NOT NULL DEFAULT 0.0000 COMMENT '映票余额',
  `votestotal` decimal(20, 4) UNSIGNED NOT NULL DEFAULT 0.0000 COMMENT '映票总额',
  `province` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '省份',
  `city` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '城市',
  `isrecommend` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0 未推荐 1 推荐',
  `openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '三方标识',
  `login_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'phone' COMMENT '注册方式',
  `iszombie` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否开启僵尸粉',
  `isrecord` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否开起回放',
  `iszombiep` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否僵尸粉',
  `issuper` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否超管',
  `ishot` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否热门显示',
  `goodnum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '当前装备靓号',
  `source` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'pc' COMMENT '注册来源',
  `roomnum` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '房号',
  `isshare` tinyint(1) NULL DEFAULT 0 COMMENT '是否公共主播 0-否 1-是',
  `issendred` tinyint(1) NULL DEFAULT 0 COMMENT '是否可以发送红包 0-不可以 1-可以',
  `isprivatemsg` tinyint(1) NULL DEFAULT 0 COMMENT '是否可以发送私信 0-不可以 1-可以',
  `game_user_id` bigint(20) NULL DEFAULT NULL COMMENT '游戏系统用户id',
  `game_tenant_id` bigint(20) NULL DEFAULT NULL COMMENT '游戏系统租户id',
  `zone` int(8) NULL DEFAULT NULL COMMENT '区号',
  `frozen_coin` decimal(12, 4) NOT NULL DEFAULT 0.0000 COMMENT '金币冻结金额',
  `frozen_votes` decimal(12, 4) NOT NULL DEFAULT 0.0000 COMMENT '映票冻结金额',
  `integral` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '积分',
  `addup_integral` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '累计积分',
  `watch_num` int(11) NOT NULL DEFAULT 0 COMMENT '赠送观影次数',
  `watch_time` int(11) NOT NULL DEFAULT 0 COMMENT '赠送观影时长',
  `recharge_num` int(11) NOT NULL DEFAULT 0 COMMENT '充值次数',
  `firstrecharge_coin` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '首充金额',
  `withdrawable_money` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '可提现金额',
  `follows` int(11) NOT NULL DEFAULT 0 COMMENT '关注数量',
  `fans` int(11) NOT NULL DEFAULT 0 COMMENT '粉丝数量',
  `beauty` varchar(5000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '美颜效果设置',
  `act_uid` int(11) NOT NULL DEFAULT 0 COMMENT '操作人id',
  `mtime` int(11) NOT NULL DEFAULT 0 COMMENT '修改时间',
  `familyids` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '管理家族id',
  `operate_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '操作人',
  `remark` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `isshutup` tinyint(2) NULL DEFAULT 0 COMMENT '是否禁言',
  `isforbidlive` tinyint(2) NULL DEFAULT 0 COMMENT '是否禁播',
  `userlevel` int(12) NULL DEFAULT NULL COMMENT '会员等级',
  `roomtype_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0,2,3' COMMENT '房间类型',
  `isjurisdiction` tinyint(3) NOT NULL DEFAULT 0 COMMENT '聊天室权限 0:关闭,1:开启',
  `is_allow_post` tinyint(4) NULL DEFAULT 1 COMMENT '是否允许发贴，1 允许，2不允许',
  `is_allow_comment` tinyint(4) NULL DEFAULT 1 COMMENT '是否允许评论 1 允许 ，2不允许',
  `is_allow_seeking_slice` tinyint(4) NULL DEFAULT 1 COMMENT '是否允许求片 1  允许 ，2 不允许',
  `is_allow_push_slice` tinyint(4) NULL DEFAULT 1 COMMENT '是否允许推片 1  允许， 2 不允许',
  `withdrawable_push_slice` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '可提现推片赏金（已加到余额）',
  `no_withdrawable_push_slice` decimal(20, 4) NULL DEFAULT 0.0000 COMMENT '不可提现推片赏金（已加到不可提现余额）',
  `isglr` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否领取首次登录奖励：0.否，1.是',
  `version` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'app版本',
  `client` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户客户端',
  `pids` varchar(4000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '上级用户id',
  `pid` int(11) NOT NULL DEFAULT 0 COMMENT '上级用户 ',
  `agent_total_income` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '代理总收入',
  `watchtime` int(10) NOT NULL DEFAULT 0 COMMENT '会员观看直播时长',
  `vip_margin` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '保证金',
  `like_deposit` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '已缴纳的点赞保证金',
  `recharge_total` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '充值总额',
  `actual_recharge_total` decimal(20, 4) NOT NULL DEFAULT 0.0000 COMMENT '实际到账 总额',
  `is_certification` tinyint(4) NOT NULL DEFAULT 0 COMMENT ' 是否官方认证 0 没认证 1  已认证',
  `certification_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '官方名称',
  `yeb_balance` decimal(12, 2) NOT NULL DEFAULT 0.00 COMMENT '余额宝余额',
  `yeb_isopen` tinyint(1) NOT NULL DEFAULT 0 COMMENT '余额宝是否开启',
  `reg_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `reg_key` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '域名对应的key',
  `turntable_times` int(11) NOT NULL DEFAULT 0 COMMENT '转盘次数',
  `upload_video_profit_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '上传视频收益：0.关闭，1.开启',
  `grab_red_packet_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '抢红包：0.关闭，1.开启',
  `rebate_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '代理返点：0.关闭，1.开启',
  `agent_code` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邀请码',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `user_login`(`user_login`, `tenant_id`, `user_type`) USING BTREE,
  UNIQUE INDEX `game_user_login`(`game_user_id`, `game_tenant_id`) USING BTREE COMMENT '游戏系统用户唯一索引',
  INDEX `user_login_key`(`user_login`) USING BTREE,
  INDEX `index_ishot_isrecommend`(`ishot`, `isrecommend`) USING BTREE,
  INDEX `user_nicename`(`user_nicename`) USING BTREE,
  INDEX `user_type`(`user_type`) USING BTREE,
  INDEX `idx_user_type_id_user_login`(`user_type`, `id`, `user_login`) USING BTREE,
  INDEX `user_type_tenant_id`(`user_type`, `tenant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 99294 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

