-- ----------------------------
-- Table structure for cmf_users_action
-- ----------------------------
DROP TABLE IF EXISTS `cmf_users_action`;
CREATE TABLE `cmf_users_action`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `uid` int(10) NOT NULL DEFAULT 0 COMMENT '用户ID',
  `user_login` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户账号',
  `vip` int(11) NOT NULL DEFAULT 1 COMMENT 'vip等级',
  `addup_integral` bigint(20) NOT NULL DEFAULT 0 COMMENT '累计积分',
  `action_type` tinyint(3) NOT NULL COMMENT '用户行为',
  `action_time` int(11) NOT NULL DEFAULT 0 COMMENT '操作数量/观看时长',
  `tenant_id` int(11) NOT NULL COMMENT '租户',
  `start_integral` bigint(20) NOT NULL DEFAULT 0 COMMENT '发生前积分',
  `change_integral` bigint(20) NOT NULL DEFAULT 0 COMMENT '发生积分',
  `end_integral` bigint(20) NOT NULL DEFAULT 0 COMMENT '操作后积分',
  `status` tinyint(2) NOT NULL DEFAULT 1 COMMENT '状态：0未发放，1已发放',
  `ctime` int(11) NOT NULL DEFAULT 0 COMMENT '用户行为时间',
  `giveout_time` int(11) NOT NULL DEFAULT 0 COMMENT '发放时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_users_agent
-- ----------------------------
DROP TABLE IF EXISTS `cmf_users_agent`;
CREATE TABLE `cmf_users_agent`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT 0 COMMENT '用户id',
  `user_login` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户名',
