  `three_uid` int(11) NOT NULL DEFAULT 0 COMMENT '上上上级id',
  `four_uid` int(11) NOT NULL DEFAULT 0 COMMENT '上上上上级id',
  `five_uid` int(11) NOT NULL DEFAULT 0 COMMENT '上上上上上级id',
  `addtime` int(11) NOT NULL DEFAULT 0 COMMENT '时间',
  `tenant_id` bigint(20) NULL DEFAULT 0,
  `user_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '用户类型：用户类型: 2.会员, 3.虚拟用户, 4.游客, 5.包装账号, 6.代管账号, 7.测试账号',
  PRIMARY KEY (`id`) USING BTREE,
