-- ----------------------------
-- Table structure for cmf_users_auth
-- ----------------------------
DROP TABLE IF EXISTS `cmf_users_auth`;
CREATE TABLE `cmf_users_auth`  (
  `uid` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户ID',
  `real_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '姓名',
  `mobile` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '电话',
  `cer_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '身份证号',
  `front_view` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '正面',
  `back_view` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '反面',
  `handset_view` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手持',
  `reason` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '审核说明',
  `addtime` int(12) NOT NULL DEFAULT 0 COMMENT '提交时间',
  `uptime` int(12) NOT NULL DEFAULT 0 COMMENT '更新时间',
