  PRIMARY KEY (`uid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_users_basicsalary
-- ----------------------------
DROP TABLE IF EXISTS `cmf_users_basicsalary`;
CREATE TABLE `cmf_users_basicsalary`  (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uid` int(12) NOT NULL DEFAULT 0 COMMENT '会员id',
  `collet_day` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '时间',
  `user_login` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '会员名称',
  `money` decimal(16, 2) NULL DEFAULT NULL COMMENT '底薪（获得薪水）\r\n',
