  `pushpull_id` int(11) NOT NULL DEFAULT 0 COMMENT '直播推拉流id',
  `pull` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '播流地址',
  `push` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '推流地址',
  `flvpull` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'flv播流地址',
  `m3u8pull` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'm3u8播流地址',
  `lng` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '经度',
  `lat` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '维度',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '直播类型：0.普通房间，1.密码房间，2.门票房间，3.计时房间',
  `type_val` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '类型值',
  `isvideo` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否假视频：0.否，1是',
  `is_football` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否是足球直播：0.否，1.是',
  `football_live_match_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '足球视频直播比赛ID',
  `football_live_time_stamp` int(11) NOT NULL DEFAULT 0 COMMENT '足球视频直播时间戳',
  `wy_cid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '网易房间ID(当不使用网易是默认为空)',
  `game_action` tinyint(1) NOT NULL DEFAULT 0 COMMENT '游戏类型',
  `banker_coin` int(11) NOT NULL DEFAULT 10000000 COMMENT '平台庄家余额',
  `goodnum` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '靓号',
  `anyway` tinyint(1) NOT NULL DEFAULT 1 COMMENT '横竖屏，0表示竖屏，1表示横屏',
  `liveclassid` int(11) NOT NULL DEFAULT 0 COMMENT '直播分类ID',
  `hotvotes` int(11) NOT NULL DEFAULT 0 COMMENT '热门礼物总额',
  `pkuid` int(11) NOT NULL DEFAULT 0 COMMENT 'PK对方ID',
  `pkstream` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'pk对方的流名',
  `ismic` int(11) NULL DEFAULT NULL COMMENT '连麦开关，0关1开',
  `isshare` tinyint(1) NULL DEFAULT NULL COMMENT '是否公共主播 0-否 1-是',
  `roomnum` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '房号',
  `tenant_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '租户id',
  `game_user_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '游戏系统用户id',
  `game_theme` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '游戏主题',
  `hotorderno` int(3) NOT NULL DEFAULT 0 COMMENT '热门排序',
  `recommendno` int(3) NOT NULL DEFAULT 0 COMMENT '推荐排序',
  `ishot` int(3) NOT NULL DEFAULT 0 COMMENT '是否上热门',
  `isrecommend` int(3) NOT NULL DEFAULT 0 COMMENT '是否上推荐',
  `isrecommendroom` int(3) NOT NULL DEFAULT 0 COMMENT '直播间推荐',
  `top` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否置顶：0.否，1.是',
  `toptime` int(11) NOT NULL DEFAULT 0 COMMENT '置顶时间',
  `ly_recommend` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否光年推荐：0.否，1.是',
  `game_recommend` tinyint(1) NOT NULL DEFAULT 0 COMMENT '游戏推荐：0.否，1.是',
  `tryWatchTime` int(3) NOT NULL DEFAULT 0 COMMENT '试看时长',
  `lottery_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '彩种id',
  `recommend_lottery_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '推荐彩种id',
  `show_game_entry` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否展示游戏入口 1 展示 0 不展示',
  `show_offers` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否显示优惠活动 1 展示 0 不展示',
  `show_dragon_assistant` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否显示长龙助手 1 是 0 否',
  `show_reward_reporting` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否显示举报有奖  1 显示 0 不显示',
  `enable_follow` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否启用跟投 1 启用 0 不启用',
  `act_uid` int(11) NOT NULL DEFAULT 0 COMMENT '操作人id',
  `mtime` int(11) NOT NULL DEFAULT 0 COMMENT '修改时间',
  `pause_time` int(11) NOT NULL DEFAULT 0 COMMENT '暂停时间',
  `recover_time` int(11) NOT NULL DEFAULT 0 COMMENT '恢复时间',
  `stop_time` int(11) NOT NULL DEFAULT 0 COMMENT '累计暂停时长',
  `label_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '彩种标签名称',
  PRIMARY KEY (`uid`) USING BTREE,
  UNIQUE INDEX `uid-unique`(`uid`) USING BTREE,
  INDEX `index_islive_starttime`(`islive`, `starttime`) USING BTREE,
  INDEX `index_uid_stream`(`uid`, `stream`) USING BTREE,
  INDEX `tenant_id`(`tenant_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

