  `video_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `hot_searches` int(11) NOT NULL DEFAULT 0 COMMENT '热搜次数',
  `first_watch_time` int(11) NOT NULL DEFAULT 0 COMMENT '第一次观看时间',
  `last_watch_time` int(11) NOT NULL DEFAULT 0 COMMENT '最后一次观看时间',
  `total_warch_time` int(11) NOT NULL DEFAULT 0 COMMENT '全部用户观看时长（预留字段。暂未用到）',
  `desc` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '剧情简介',
  `years` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '年代',
  `region` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '地区',
  `playTimeInt` int(11) NOT NULL DEFAULT 0 COMMENT '时长(秒)',
