  `try_watch_time` int(5) NULL DEFAULT NULL COMMENT '试看时间',
  `buy_numbers` int(10) NOT NULL DEFAULT 0 COMMENT '购买次数',
  `backstage_thumb` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '后台封面地址',
