-- ----------------------------
-- Table structure for cmf_yh_task
-- ----------------------------
DROP TABLE IF EXISTS `cmf_yh_task`;
CREATE TABLE `cmf_yh_task`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(160) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务名称',
  `description` varchar(160) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务描述',
  `price` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '任务价格',
  `start_time` int(11) NOT NULL COMMENT '生效时间',
  `end_time` int(11) NOT NULL COMMENT '失效时间',
  `client` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '客户端：1PC，2H5，3Android，4iOS',
  `type` tinyint(2) NOT NULL COMMENT '任务类型：1初级任务，2中级任务，3高级任务',
  `classification` int(11) NOT NULL COMMENT '任务分类',
  `sort` tinyint(4) NOT NULL DEFAULT 1 COMMENT '排序',
  `img` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '图片地址',
  `reward1_number` int(10) NOT NULL DEFAULT 0 COMMENT '完成奖励1 转盘次数',
  `reward1` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '完成奖励1',
  `reward2_upgrade_vip` int(11) NOT NULL DEFAULT 0 COMMENT '完成奖励2：是否升级VIP等级: 0否，1是',
  `is_manual_check` tinyint(2) NOT NULL DEFAULT 0 COMMENT '人工审核：0否，1是',
  `is_upleveltask` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否需要上一级任务完成：0否，1是',
  `task_details_type` tinyint(2) NOT NULL DEFAULT 0 COMMENT '任务详情类型：0富文本，1网页',
  `task_details` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '任务详情说明',
  `status` tinyint(2) NOT NULL COMMENT '任务状态：0失效，1生效',
  `act_uid` int(11) NOT NULL DEFAULT 0 COMMENT '操作人id',
  `mtime` int(11) NOT NULL DEFAULT 0 COMMENT '操作时间',
  `only_one` tinyint(2) NOT NULL DEFAULT 0 COMMENT '任务策略',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of cmf_yh_task
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_yh_task_classification
-- ----------------------------
DROP TABLE IF EXISTS `cmf_yh_task_classification`;
CREATE TABLE `cmf_yh_task_classification`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(2) NOT NULL COMMENT '任务等级',
  `name` varchar(160) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '分类名称',
  `description` varchar(160) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '分类描述',
  `commission_rate` double(4, 3) NOT NULL DEFAULT 0.000 COMMENT '佣金比例（不要设置百分比，直接写0.01）',
  `daily_task` int(11) NOT NULL COMMENT '每日任务数限制',
  `unlock_amount` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '解锁金额（解锁条件1）',
  `direct_invitation` int(11) NOT NULL DEFAULT 0 COMMENT '直邀人数（解锁条件2，不需要可设置为0）',
  `max_amount` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '订单最高金额',
  `min_amount` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '订单最低金额',
  `limit_max_balance` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '上限金额(账户资金余额)',
  `space_time` int(11) NOT NULL DEFAULT 0 COMMENT '任务间隔（秒）',
  `status` tinyint(2) NOT NULL DEFAULT 0 COMMENT '分类状态',
  `experience_shop` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否体验商城',
  `logo` varchar(655) CHARACTER SET utf8 COLLATE utf8_unicode_ci NULL DEFAULT NULL COMMENT '分类LOGO（不用修改）',
  `bgimg` varchar(655) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '分类背景图',
  `act_uid` int(11) NOT NULL DEFAULT 0 COMMENT '操作人id',
  `mtime` int(11) NOT NULL DEFAULT 0 COMMENT '操作时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of cmf_yh_task_classification
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_yh_task_rewardlog
-- ----------------------------
DROP TABLE IF EXISTS `cmf_yh_task_rewardlog`;
CREATE TABLE `cmf_yh_task_rewardlog`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '用户id',
  `vip_id` int(11) NOT NULL COMMENT '会员等级',
  `type` tinyint(2) NOT NULL COMMENT '任务类型：1初级任务，2中级任务，3高级任务	',
  `task_id` int(11) NOT NULL COMMENT '任务id',
  `task_name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务名称',
  `user_task_id` int(11) NOT NULL COMMENT '用户任务id',
  `reward_type` tinyint(2) NOT NULL COMMENT '奖励类型：1奖励1类型奖励，2奖励2类型奖励，3奖励3转盘次数',
  `reward1` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '完成奖励1',
  `reward2_upgrade_vip` tinyint(2) NOT NULL COMMENT '完成奖励2：是否升级VIP等级: 0否，1是',
  `start_time` int(11) NOT NULL DEFAULT 0 COMMENT '生效时间',
  `end_time` int(11) NOT NULL DEFAULT 0 COMMENT '失效时间',
  `reward_start_amount` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '奖励前金额',
  `reward_result` varchar(160) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '奖励结果',
  `reward_end_amount` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '奖励后金额',
  `reward_end_vip` int(11) NOT NULL DEFAULT 0 COMMENT '奖励后VIP等级',
  `giveout_type` tinyint(2) NOT NULL DEFAULT 0 COMMENT '发放类型： 0系统自动发放，1人工审核',
  `status` tinyint(2) NOT NULL DEFAULT 0 COMMENT '状态：发放0未发放，1已发放',
  `tenant_id` int(11) NOT NULL COMMENT '租户id',
  `mtime` int(11) NOT NULL DEFAULT 0 COMMENT '操作时间',
  `reward1_number` int(10) NOT NULL DEFAULT 0 COMMENT '完成奖励3：转盘次数',
  `reward_end_number` int(10) NOT NULL DEFAULT 0 COMMENT '奖励后转盘次数',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 16 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci ROW_FORMAT = Dynamic;

